import { useSelector, useDispatch } from 'react-redux';
import { ucitajSveNastavnike } from '../redux/nastavnici/actions';
import styles from './Nastavnici.module.css';
import { Link } from 'react-router-dom';
import Nastavnik from './Nastavnik';

function Nastavnici() {
  const nastavnici = useSelector((state) => state.nastavnici);
  console.log(nastavnici.items);
  const dispatch = useDispatch();

  const filter = (id) => {
    console.log(id);
    nastavnici.items.filter(id);
  };
  console.log(123, filter);
  return (
    <div>
      {nastavnici && (
        <button
          onClick={() => {
            dispatch(ucitajSveNastavnike());
          }}
        >
          Svi nastavnici
        </button>
      )}

      {nastavnici.items.map((nast) => {
        return (
          <div key={nast.idNastavnik} className={styles.nastavnici}>
            <Nastavnik
              id={nast.idNastavnik}
              ime={nast.ime}
              prezime={nast.prezime}
            />
            <Link
              to={'/nastavnici/' + nast.idNastavnik}
              onClick={filter(nast.idNastavnik)}
            >
              Details
            </Link>
          </div>
        );
      })}
      {nastavnici.items.length === 1 && <Nastavnik>ooooooooo</Nastavnik>}
    </div>
  );
}

export default Nastavnici;
